import React from "react";

const styles = {
    topnav : {
        backgroundColor: '#333',
        overflow: 'hidden',
        'a' : {
            float: 'left',
            color: '#f2f2f2',
            textAlign: 'center',
            padding: '14px 16px',
            textDecoration: 'none',
            fontSize: '17px',
        },
        'a:hover' : {
            backgroundColor: '#ddd',
            color: 'black'
          },
        'a.active' : {
            backgroundColor: '#04AA6D',
            color: 'white',
        }
      },
}

function NavBar(props) {
    return (
        <div style={(styles.topnav)}>
  <a style={(styles.topnav["a.active"])} href="#home">Home</a>
  <a href="#news">News</a>
  <a href="#contact">Contact</a>
  <a href="#about">About</a>
</div>
  );
}

export default NavBar;
